import React from 'react';
import Container from 'react-bootstrap/Container';

import Hero from '../components/Hero';

function HomePage(props) {

    return (
        <div>
            <Container fluid={true}>
                <Hero title={props.title} />
            </Container>
        </div>
    );

}

export default HomePage;
